import React, {Component} from 'react'

class First extends Component {
    
    render () {
        return (
            <div>
                <h2>Daffodil International University</h2>
                <h3>Md.Ayub Shamim</h3>
                <p>Hello deear ,here is new properties grow up day by day</p>
            </div>
        )
    }
}

export default First
